import React from 'react'
import '../styles/Output.css'

const Output = props => {
    return(
        <div className='OutputWrapper'>
            { props.output ? props.output.map((char, bit) => <p>{char + bit}</p>) : <p>Enter some text and compile...</p> }
        </div>
    )
}

export default Output
